namespace lokiloggerreporter.Services {
	public static class InitHelper {

		public static void UpdateDatabaseCtx(DatabaseCtx ctx)
		{
			foreach (var log in ctx.Logs.Where(x => x.LogTyp == LogTyp.RestCall))
			{
				try
				{
					WebRequest request = JsonConvert.DeserializeObject<WebRequest>(log.Data);
					log.WebRequest = request;
				}
				catch (Exception e)
				{
					Console.WriteLine(e);
				}
			}

			ctx.SaveChanges();
		}

		public static void CreateSource(DatabaseCtx ctx)
		{
			if(!ctx.Sources.Any()){
				Source source = new Source()
				{
					Name = "Test",
					Description = "Test Source",
					Secret = "1234",
					Tag = "Tag",
					Version = "20"
				};
				ctx.Sources.Add(source);
				ctx.SaveChanges();
			}
		}
		
		
		public static void AddLogs(DatabaseCtx ctx)
		{
			Source source = ctx.Sources.First();
			if(!ctx.Logs.Any()){
				ctx.Logs.Add(new Log()
				{
					Class = "asdas",
					Data = "asdpkdf",
					LogTyp = LogTyp.Exception,
					Exception = "Hallo \\n asdsad \\n  sdafgdf",
					Message = "Du bist hallo",
					LogLevel = LogLevel.Critical,
					SourceId = source.SourceId,
					Time = DateTime.Now.AddDays(-100)
				});
				
				ctx.Logs.Add(new Log()
				{
					SourceId = source.SourceId,
					Class = "asdas",
					Data = "asdpkdf",
					LogTyp = LogTyp.Exception,
					Message = "Du bist hallo",
					LogLevel = LogLevel.Critical,
					Time = DateTime.Now.AddDays(-100)
				});
				ctx.Logs.Add(new Log()
				{
					SourceId = source.SourceId,
					Class = "asdas",
					Data = "asdpkdf",
					LogTyp = LogTyp.Exception,
					Message = "Du bist hallo",
					LogLevel = LogLevel.Critical,
					Time = DateTime.Now
				});
				ctx.Logs.Add(new Log()
				{
					SourceId = source.SourceId,
					Class = "sdfgsdfg",
					Data = "Information",
					LogTyp = LogTyp.Normal,
					LogLevel = LogLevel.Information,
					Time = DateTime.Now
				});
				ctx.Logs.Add(new Log()
				{
					SourceId = source.SourceId,
					Class = "sdfgsdfg",
					Data = "Information",
					LogTyp = LogTyp.Normal,
					LogLevel = LogLevel.Information,
					Time = DateTime.Now
				});
				ctx.Logs.Add(new Log()
				{
					SourceId = source.SourceId,
					Class = "sdfgsdfg",
					Data = "Information",
					LogTyp = LogTyp.Normal,
					LogLevel = LogLevel.Information,
					Time = DateTime.Now
				});
				var data = JsonConvert.DeserializeObject<List<Log>>(GetDemoData());
				ctx.Logs.AddRange(data);
				ctx.SaveChanges();
			}
		}

		public static void SetSettings(ISettingsService settingsService)
		{
			settingsService.Set("SourceLogCountTime",TimeSpan.FromDays(-1));
			settingsService.Set("MaxResultCount",10000);
			
		}

